{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/cedricasante/rental-property-price-prediction-with-xgboost?scriptVersionId=99384264\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"4e07ba7a","metadata":{"papermill":{"duration":0.012095,"end_time":"2022-06-26T19:31:59.009333","exception":false,"start_time":"2022-06-26T19:31:58.997238","status":"completed"},"tags":[]},"source":["# 1.0 Estimating Short-term Rental Property Prices\n","\n","### 1.1 Backrgound \n","\n","A short-term rental property is one with a lease period of less than 12 months. It could be a single-family or multi-family house, a condo, or a townhome. The owner usually purchases this type of property with the intention of leasing it and does not reside in it.\n","\n","Vacation houses and Airbnbs are popular short-term rentals in prominent tourist areas. They do, however, work with renters who require a place to stay for less than a year, which is considered a conventional lease length.\n","\n","In recent years, the sector has evolved from a side hustle for homeowners trying to supplement their income to a thriving industry in several locations across the country.\n","\n","As a result, homeowners must now post their property for short-term rentals on an online platforms in order to be seen and patronized. Despite the fact that these properties are widely considered to be excellent investments, they necessitate careful maintenance and an understanding of the local real estate market.\n","\n","### 1.2 Purpose\n","The purpose of this report to suggest a system that will enable renters estimate the money they could earn renting out their living space on the Inn the Neighborhood website.\n","\n","The data you will use for this analysis can be accessed here: `\"data/rentals.csv\"`"]},{"cell_type":"markd