26T19:32:28.582073Z","shell.execute_reply":"2022-06-26T19:32:28.580282Z"},"papermill":{"duration":0.350275,"end_time":"2022-06-26T19:32:28.584944","exception":false,"start_time":"2022-06-26T19:32:28.234669","status":"completed"},"tags":[]},"outputs":[{"data":{"text/html":["6050"],"text/latex":["6050"],"text/markdown":["6050"],"text/plain":["[1] 6050"]},"metadata":{},"output_type":"display_data"},{"data":{"text/html":["2061"],"text/latex":["2061"],"text/markdown":["2061"],"text/plain":["[1] 2061"]},"metadata":{},"output_type":"display_data"},{"name":"stdout","output_type":"stream","text":["[1] \"vtreat 1.6.3 inspecting inputs Sun Jun 26 19:32:28 2022\"\n","[1] \"designing treatments Sun Jun 26 19:32:28 2022\"\n","[1] \" have initial level statistics Sun Jun 26 19:32:28 2022\"\n","[1] \" scoring treatments Sun Jun 26 19:32:28 2022\"\n","[1] \"have treatment plan Sun Jun 26 19:32:28 2022\"\n"]}],"source":["## Gradient boosting\n","suppressPackageStartupMessages(library(vtreat))\n","\n","vars <- c(\"latitude\", \"longitude\",\"property_type\",\"room_type\")\n","\n","#Splitting data into train and test data\n","set.seed(3456)\n","\n","N <- nrow(rlcc)\n","\n","# Calculate how many rows 75% of N should be and print it\n","# Hint: use round() to get an integer\n","target <- round(N * 0.75)\n","\n","# Create the vector of N uniform random variables: gp\n","gp <- runif(N)\n","\n","# Use gp to create the training set: train (75% of data) and test (25% of data)\n","train.r <- rlcc[gp < 0.75,]\n","test.r <- rlcc[gp >= 0.75,]\n","nrow(train.r)\n","nrow(test.r)\n","\n","# Creating a treatment plan\n","treatplan <- designTreatmentsZ(train.r, vars)\n","\n","# Examine the scoreFrame\n","scoreFrame <- treatplan %>%\n","    magrittr::use_series(scoreFrame) %>%\n","    select(varName, origName, code)\n","\n","# We want only these\n","newvars <- scoreFrame %>%\n","    filter(code %in% c(\"clean\", \"lev\")) %>%\n","    magrittr::use_series(varName)\n","\n","# Create the treated training 