, Camper/RV, In-law,\n","    - Earth house, Cabin, Dome house, Hut, Other.\n","\n","Apartments make up 40% of all properties, houses make up 29%, and condominiums account for 11% of all properties. In this case, the median nightly rate is \\$153, \\$130, and \\$200, respectively.\n","\n","At \\$20, the Camper/RV is the least median expensive property kind, while the Earth home is the most expensive.\n","\n","### Model Building\n","\n","To build (or train) a model that can predict values for new or different data, predictive models employ previous outcomes. Predictions based on the estimated relevance of a set of input variables are produced by modeling and reflect a probability of the target variable (for example, nightly rate).\n","\n","As there is the need to estimate prices charged per night, there is a need to build a model to predict prices based on the given independent variables(room type, bedrooms and more) that are provided.\n","\n","Prediction test accuracies as well as Root Mean Squared are calculated. These measures are useful for determining whether a model is adequate.\n","\n","| Model | RMSE | Prediction Accuracy |\n","| --- | --- | --- |\n","| Random Forest |281.14 | 33.8% |\n","| XGBOOST | 251.81 | 46.9% |"]},{"cell_type":"markdown","id":"04e32825","metadata":{"papermill":{"duration":0.036055,"end_time":"2022-06-26T19:32:30.984004","exception":false,"start_time":"2022-06-26T19:32:30.947949","status":"completed"},"tags":[]},"source":["##  Conclusion\n","People should be able to estimate how much money they can make by renting out their homes which will in turn increase the conversion. \n","\n","A machine learning algorithm like Gradient boosting is the best model that can better predict the prices since it has a prediction 46.9%. Since 46.9% accuracy is not viable enough to avoid estimating more than \\$25 of the actual prices, we cannot fully rely on it.\n","\n","Therefore there is the need to add better quantifiable predictors in order to increase the accuracy of the suggested model.\n"]}],"metadata":{"editor":"DataCamp Workspace","kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":35.611945,"end_time":"2022-06-26T19:32:31.139428","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-06-26T19:31:55.527483","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}